// React
import React from 'react';

// Import components
import Navigation from './Navigation.js';
import Footer from './Footer.js';

// Import CSS for the page and content
import './css/Page.css';
import './css/RedMirage.css';

// Import images
import redMirageMap from './images/red_mirage_map.svg';

// Content for Red Mirage
function RedMirage() {

    // No transition for the navigation on pages
    return (
        <div>
            <Navigation transition={ false }/>

                {/* Receive the content */}
                <div className='container-page'>
                    <div className='container-content'>

                        {/* Title section */}
                        <img src={ redMirageMap } alt="Red Mirage" className='red-mirage-map mb-4' />
                        <h1 className='page-title mb-4'>Anticipating a Red Mirage</h1>

                        {/* Summary text */}
                        <p>
                            While working as a data scientist at Hawkfish during the 2020 election,
                            my team analyzed the changing voting method preferences of Biden and Trump supporters.
                        </p>
                    </div>
                </div>

            {/* Close out the page with the footer */}
            <Footer />
        </div>
    );
}

export default RedMirage;
